module.exports = "<!-- SITE MAIN CONTENT -->\n<main class=\"main-content\">\n\n\t<section class=\"block-banner-1 mb60\">\n\t\t<div class=\"container\">\n\t\t\t<div class=\"block-banner_caption\">\n\t\t\t\t<h2>Hoe werkt het?</h2>\n\t\t\t</div>\n\t\t</div>\n\t</section>\n\n\t<div *ngIf=\"checkDebtor() === '103016'\">\n\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Personeelsshop</h1>\n\t\t\t<p>Profiteer hier van de allerbeste December Deals! Alle producten die je wilt bestellen kun je eenvoudig in je winkelwagentje leggen en vervolgens direct afrekenen met iDeal. Houd er rekening mee dat je één keer per week je bestelling kunt ophalen in het magazijn in ’s-Hertogenbosch. Dit is op woensdag. Bestellingen geplaatst voor woensdag 12:00 zijn op dezelfde woensdag nog af te halen. Alle bestellingen geplaatst na woensdag 12:00, zijn de week erna op woensdag op te halen. Happy shopping!</p>\n\t\t</div>\n\t\t\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">December drukte</h1>\n\t\t\t<p>De deals vermeld op deze website zijn geldig t/m 31-12-2017. Door de drukte rondom Kerst kan het zijn dat sommige producten niet op voorraad zijn maar de Amazing prijzen maken het wachten meer dan goed!</p>\n\t\t</div>\n\t\t\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Je bestelling afhalen</h1>\n\t\t\t<p>\n\t\t\t\tBestellingen kunnen uitsluitend op woensdagen opgehaald worden. Alle geplaatste bestellingen liggen op woensdag vanaf 16:00 uur klaar om afgehaald te worden bij de receptie.<br/><i>LET OP! Bestellingen geplaatst tot woensdag 12:00 uur worden verwerkt. Bestellingen geplaatst na 12:00 uur liggen de eerst volgende woensdag voor je klaar!</i>\n\t\t\t</p>\n\t\t</div>\n\t\t\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Heb jij een kortingscode/cadeaubon?</h1>\n\t\t\t<p>\n\t\t\t\tHeb jij een kortingscode/cadeaubon ontvangen? Check deze dan op de homepage van de shop. Ga met dit shop-tegoed volledig uit je plaat en bestel de mooiste producten! De kortingscode/cadeaubon is slecht één keer te verzilveren. Zorg dus dat je alle gewenste producten in één bestelling plaatst. De restwaarde komt automatische te vervallen.<br/><i>LET OP! De kortingscodes/cadeaubon is geldig t/m 31 december 2017!</i>\n\t\t\t</p>\n\t\t</div>\n\t\t\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Bol.com cadeaukaart</h1>\n\t\t\t<p>\n\t\t\t\tHeb jij een kortingscode/cadeaubon, ben je langer dan 1 jaar in dienst bij Amacom en heb je niets leuks in de shop kunnen vinden? Dan kun je jouw kortingscode/cadeaubon verzilveren voor een cadeaukaart van Bol.com. Dit doe je eenvoudig in de shop.\n\t\t\t\t<br/><i>LET OP! De cadeaukaart van Bol.com vertegenwoordigd 2/3e van de waarde van je kortingscode/cadeaubon, de restwaarde komt te vervallen!</i>\n\t\t\t</p>\n\t\t</div>\n\t\n\t</div>\n\t\n\t<div *ngIf=\"checkDebtor() === '103017'\">\n\t\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Loyalty shop</h1>\n\t\t\t<p>Profiteer hier van de allerbeste deals! Alle producten die je wilt bestellen kun je eenvoudig in je winkelwagentje leggen en vervolgens direct afrekenen met iDeal. Happy shopping!</p>\n\t\t</div>\n\t\t\n\t\t<div class=\"container\">\n\t\t\t<h1 class=\"pageTitle\">Heb jij een kortingscode/cadeaubon?</h1>\n\t\t\t<p>\n\t\t\t\tHeb jij een kortingscode/cadeaubon ontvangen? Ga dan met dit shop-tegoed volledig uit je plaat en bestel de mooiste producten! De kortingscode/cadeaubon is slecht één keer te verzilveren. Zorg dus dat je alle gewenste producten in één bestelling plaatst. De restwaarde komt automatische te vervallen.\n\t\t\t</p>\n\t\t</div>\n\t\n\t</div>\n\t\n</main>"

