module.exports = "<!-- SITE MAIN CONTENT -->\n<main class=\"main-content\">\n\t<div class=\"container\">\n\t\t<h1 class=\"pageTitle\">Bestelling</h1>\n\t\t<p>Wil jij een product bestellen? Plaats dan heel eenvoudig een bestelling in 6 stappen!</p> \n\t\t<p>\n\t\t\t<b>1. Selecteer jouw product</b><br/>\n\t\t\tIn onze shop selecteer je gemakkelijk het product waarin jij geïnteresseerd bent.\n\t\t</p>\n\t\t<p>\n\t\t\t<b>2. Productpagina</b><br/>\n\t\t\tOp de productpagina plaats je het product in het winkelmandje door op \"Voeg toe\" te klikken. Dit is alleen mogelijk als het product op voorraad is. Één keer klikken staat gelijk aan het product één keer toevoegen.\n\t\t</p>\n\t\t<p>\n\t\t\t<b>3. Winkelwagen</b><br/>\n\t\t\tDoor rechts bovenin op de winkelwagen te klikken zie je het door jou geselecteerde product. Controleer of dit het juiste product is én of het gewenste aantal is ingevoerd. Klopt dit? Klik dan op de knop \"Bestellen\" om door te gaan naar de persoonlijke gegevens.\n\t\t</p>\n\t\t<p>\n\t\t\t<b>4. Persoonlijke gegevens</b><br/>\n\t\t\tVul het formulier in met je gegevens, zodat wij het product naar het juiste adres sturen. Velden waar een * bij staat zijn verplicht om in te vullen en de bestelling af te kunnen ronden. Je kunt hier eventueel een opmerking achterlaten en je gegevens opslaan voor een volgende bestelling. \n\t\t\tLet op. Jij dient akkoord te gaan met de algemene voorwaarden om de bestelling af te kunnen ronden.\n\t\t</p>\n\t\t<p>\n\t\t\t<b>5. Betaling</b><br/>\n\t\t\tSelecteer de gewenste betaalmethode en volg de daarbij behorende instructies. Meer informatie over de verschillende betaalmethodes vind je op de pagina Betaling onder het kopje \"Klantenservice\". \n\t\t</p>\n\t\t<p>\n\t\t\t<b>6. Bevestiging</b><br/>\n\t\t\tWanneer de bestelling succesvol is afgerond, ontvang je een bevestigingsmail op het door jou opgegeven e-mailadres. Lees alles over het bezorgproces onder Verzending & Bezorging.\n\t\t</p>\n\t</div>\n</main>"

