module.exports = "<!-- SITE MAIN CONTENT -->\n<main class=\"main-content\">\n\t<div class=\"container\">\n\t\t<h1 class=\"pageTitle\">Retouren & Garantie</h1>\n\t\t<h3>Retouren of ruilen</h3>\n\t\t<p>\n\t\t\tEen aankoop retourneren of ruilen voor een ander product? Uiteraard is dat bij Gezamenlijk Voordeel gewoon mogelijk! De volgende voorwaarden zijn dan van toepassing:\n\t\t</p>\n\t\t<p>Voorwaarden</p>\n\t\t<ul>\n\t\t\t<li>Retourneren binnen 14 dagen na aankoop;</li>\n\t\t\t<li>Retourneren is mogelijk als het product nog in de originele verpakking zit;</li>\n\t\t\t<li>De retourzending wordt geaccepteerd met volledig ingevuld retourformulier;</li>\n\t\t\t<li>Voeg tevens (een kopie van) het aankoopbewijs toe;</li>\n\t\t\t<li>Nadat de bestelling retour gekomen is, wordt het aankoopbedrag direct teruggestort;</li>\n\t\t</ul>\n\t\t<p>Meld je retour altijd bij onze klantenservice. Omdat je zelf verantwoordelijk bent voor de retourzending, adviseren wij altijd een track & trace code én bewijs van verzending te vragen bij het postkantoor.</p>\n\t\t<h3>Garantie</h3>\n\t\t<p>Wij controleren de producten altijd voordat deze verstuurd worden. Mocht je desondanks niet tevreden zijn, bel dan met onze klantenservice. Zij zullen je naar tevredenheid verder helpen. Aangezien wij overtuigd zijn van de kwaliteit van onze producten, krijg je 24 maanden garantie. </p>\n\t</div>\n</main>"

